function App() {


  const getUsers = () => {
  fetch('https://jsonplaceholder.typicode.com/todos')
        .then(response => response.json())
        .then(json => console.log(json))
  };

  return (
    <div>
      <button onClick={getUsers}></button>
    </div>
  );
}

export default App;
